import { DO_LIST_CUSTOMERS, LIST_CUSTOMERS_SUCCESS, LIST_CUSTOMERS_FAILED, RESET_CUSTOMERS_SUCCESS, 
  DO_LOAD_ALL_CUSTOMERS, LOAD_ALL_CUSTOMERS_SUCCESS, LOAD_ALL_CUSTOMERS_FAILED,
  GET_AGENT, GET_SUB_AGENT, DO_CREATE_AGENT, DO_CREATE_SUB_AGENT, LOAD_ALL_AGENT_SUCCESS, LOAD_ALL_AGENT_FAILED 
}  from './../../../config/constant'

const INTIAL_STATE = {
  fetchingListCustomers: false,
  fetchingListLoading: false,
  fetchingAllDataCustomers: false,
  fetchingDataAgent: false,
  fetchingDataSubAgent: false,
  dataListCustomers: [],
  dataListAllCustomers: [],
  createAgent: {},
  dataAgent:[],
  dataSubAgent: [],
  meta: null,
  err: null
}

export default function dataCustomers(state = INTIAL_STATE, action){
  switch(action.type) {
    case DO_LIST_CUSTOMERS: {
      console.log('DO_LIST_CUSTOMER')
      return {
        ...state,
        fetchingListCustomers: true,
        fetchingListLoading: true
      }
    }
    case LIST_CUSTOMERS_SUCCESS: {
      return {
        ...state,
        fetchingListCustomers: false,
        fetchingListLoading: false,
        dataListAllCustomers: [...action.data],
        meta: action.data
      }
    }
    case LIST_CUSTOMERS_FAILED: {
      return {
        ...state,
        fetchingListCustomers: false,
        fetchingListLoading:false
      }
    }
    case RESET_CUSTOMERS_SUCCESS: {
      return {
        ...state,
        fetchingListCustomers: false,
        fetchingListLoading: false,
        dataListCustomers: []
      }
    }

    //ALL DATA CUSTOMERS
    case DO_LOAD_ALL_CUSTOMERS: {
      return {
        ...state,
        fetchingAllDataCustomers: true
      }
    }
    case LOAD_ALL_CUSTOMERS_SUCCESS: {
      return {
        ...state,
        fetchingAllDataCustomers: false,
        dataListAllCustomers: [...action.data],
        meta: action.meta
      }
    }
    case LOAD_ALL_CUSTOMERS_FAILED: {
      return {
        ...state,
        fetchingAllDataCustomers: false
      }
    }

    //DATA AGENT
    case DO_CREATE_AGENT: {
      console.log('DO_CREATE_AGENTER', state)
      return {
        ...state,
        dataAgent: [...state.dataAgent, state.createAgent]
      }
    }
    case LOAD_ALL_AGENT_SUCCESS: {
      return {
        ...state,
        fetchingDataAgent: false,
        dataAgent: [...action.email],
        meta: action.meta
      }
    }
    case LOAD_ALL_AGENT_FAILED: {
      return {
        ...state,
        fetchingDataAgent: false
      }
    }

    default: 
    return state
  }
}
